After getting so many requests on how I do my own makeup and create a flawless look, that’s easy, versatile and looks oh so fresh. 🤍

All I do is implement simple techniques and methods in my routine that gives me such kind of finish, which I personally love. ❤️

For any kind of makeup, I believe that skin prep is absolutely important and one kinds to pamper the skin as much as possible even starting with any makeup. It creates a clear canvas for any work. 💯

